import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate, Link } from 'react-router-dom';

const FeatureCard = ({ icon, title, description }) => (
  <div className="bg-white p-6 rounded-xl shadow-md flex flex-col items-center text-center">
    {icon}
    <h3 className="text-xl font-bold text-gray-800 mt-4">{title}</h3>
    <p className="text-gray-600 mt-2 text-sm">{description}</p>
  </div>
);

const LoginPage = () => {
  const [formData, setFormData] = useState({ email: '', password: '' });
  const navigate = useNavigate();

  const onChange = (e) => setFormData({ ...formData, [e.target.name]: e.target.value });

  const onSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post('http://localhost:5000/api/auth/login', formData);
      localStorage.setItem('token', res.data.token);
      alert('Login successful!');
      navigate('/details');
    } catch (err) {
      alert('Error: ' + (err.response?.data?.msg || 'Please check your credentials.'));
    }
  };

  return (
    <div className="min-h-screen flex flex-col items-center p-4">
      <div className="w-full max-w-4xl bg-white p-8 rounded-2xl shadow-xl">
        <h2 className="text-4xl font-extrabold text-center text-gray-800 mb-4">Welcome to NeuroAssess</h2>
        <p className="text-center text-gray-600 mb-10 max-w-2xl mx-auto">
          Our comprehensive platform combines cutting-edge technology with medical expertise to provide early detection screening for Alzheimer's disease. Please sign in to begin your assessment.
        </p>

        {/* Feature Cards */}
        <div className="grid md:grid-cols-3 gap-6 mb-12">
          <FeatureCard
            icon={<span className="text-5xl text-purple-600">üß†</span>}
            title="Cognitive Assessment"
            description="Advanced cognitive tests designed by neurologists"
          />
          <FeatureCard
            icon={<span className="text-5xl text-blue-600">üîä</span>}
            title="Voice Analysis"
            description="Speech pattern analysis for early detection markers"
          />
          <FeatureCard
            icon={<span className="text-5xl text-pink-600">‚öïÔ∏è</span>}
            title="MRI Integration"
            description="Upload and analyze brain imaging data"
          />
        </div>

        {/* Login Form */}
        <div className="max-w-md mx-auto p-6 bg-gray-50 rounded-lg shadow-inner">
          <h3 className="text-2xl font-bold text-center text-gray-700 mb-6">Sign In & Continue</h3>
          <form onSubmit={onSubmit} className="space-y-6">
            <div>
              <label htmlFor="email" className="block text-sm font-medium text-gray-700">Email Address</label>
              <input type="email" name="email" onChange={onChange} required
                className="mt-1 block w-full px-4 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:border-indigo-500"
              />
            </div>
            <div>
              <label htmlFor="password" className="block text-sm font-medium text-gray-700">Password</label>
              <input type="password" name="password" onChange={onChange} required
                className="mt-1 block w-full px-4 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:border-indigo-500"
              />
            </div>
            <div>
              <button type="submit" className="w-full flex justify-center py-3 px-4 border border-transparent rounded-md shadow-sm text-lg font-bold text-white bg-gradient-to-r from-red-500 to-green-500 hover:from-red-600 hover:to-green-600 transition-all duration-300 ease-in-out">
                Sign In & Continue
              </button>
            </div>
          </form>
          <p className="text-center text-gray-500 mt-6 text-sm">
            New user? Your account will be created automatically.
            {/* If you prefer a separate signup page, uncomment this line: */}
            {/* <Link to="/signup" className="font-semibold text-indigo-600 hover:text-indigo-800 ml-1">Sign Up Here</Link> */}
          </p>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
